import React from 'react';
import { useAuth } from './AuthContext';

function Profile() {
    const { logout } = useAuth();

    return (
        <div>
            <h1>Your Profile</h1>
            <p>Here you can view and edit your profile information.</p>
            <button onClick={logout}>Logout</button>
        </div>
    );
}

export default Profile;
